import React from 'react';

import HomeComponent from '../../components/Home/HomeComponent';
import LoginAuth from '../Authorization/LoginAuth';
import withAuthorization from '../../hoc/withAuthorization';


function Home(props) {

    const HomeComponentWithAuthorization = withAuthorization(HomeComponent, LoginAuth);



    return(
        <>
            
            <HomeComponentWithAuthorization />    
        </>
    )
}

export default Home
